import React, { Component } from 'react'
import styled from 'styled-components'
import { properties, fSize, fWeight } from '../../conf/properties'
import TextBox from '../TextBox/TextBox'
import bgimage from '../../assets/images/25.jpg'
import nlogo from '../../assets/images/nlogo.png'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faListAlt } from "@fortawesome/free-regular-svg-icons"
import { faBell } from "@fortawesome/free-regular-svg-icons"
import {Camera} from "react-feather"

const MainWrapper = styled.div`
  height : 54px;
  background-color : ${properties.red};
  border-bottom : 1px solid rgba(0, 40, 100, 0.12);
  display: flex;
  flex-direction: row;
  justify-content: center;
   @media (max-width: 600px) {
  height: auto;}
`
const SubWrapper = styled.div`
  width: 94%;
  /* height: inherit; */
  /* background-color : ${properties.otherBlue}; */
  display: flex;
  flex-direction: row;
  align-content: center;
  @media (max-width: 600px) {
  flex-direction: column;
  }
`
const Menu1W = styled.div`
  width: auto;
  /* background-color : ${properties.littleLightGrey}; */
  display: flex;
  flex-direction: row;
  align-content: center;
  align-items: center;
  padding: 0px 12px;
  border: 0;
  @media (max-width: 600px) {
  height: 54px;
  };
}
`
const IconDiv = styled.div`
  font-size: 12px;
  height: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
`
const MenuText = styled.div`
  margin-left: 5px;
  height: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
`
