class HeaderDown extends Component {
  render() {
    return (
      <MainWrapper>
        <SubWrapper>
          <Menu1W>
            <IconDiv>
              <FontAwesomeIcon icon={Camera} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"light"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                Home </TextBox>
            </MenuText>
          </Menu1W>
          <Menu1W>
            <IconDiv>
              <FontAwesomeIcon icon={faListAlt} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"regular"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                Attendees </TextBox>
            </MenuText>
          </Menu1W>
          <Menu1W>
            <IconDiv color={properties.blue}>
              <FontAwesomeIcon icon={faListAlt} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"regular"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                Speakers </TextBox>
            </MenuText>
          </Menu1W>
          <Menu1W>
            <IconDiv color={properties.blue}>
              <FontAwesomeIcon icon={faListAlt} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"regular"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                My Meetings </TextBox>
            </MenuText>
          </Menu1W>
          <Menu1W>
            <IconDiv color={properties.blue}>
              <FontAwesomeIcon icon={faListAlt} color={properties.lightGrey} />
            </IconDiv>
            <MenuText>
              <TextBox
                ffamily={"regular"}
                color={properties.lightGrey}
                fontSize={fSize.medium}>
                Messages </TextBox>
            </MenuText>
          </Menu1W>
        </SubWrapper>
      </MainWrapper >
    )
  }
}


export default HeaderDown
